import React from "react";
import { Navbar } from "./Navbar";

function Home() {
  return (
    <div>
      <Navbar />
      <h2>SACEM INDUSTRIES</h2>
      <p>1966</p>
      <img src="../images/sacem-logo.png" alt="" />
    </div>
  );
}

export default Home;
